css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://httpd.apache.org/"),
               url-prefix("http://apache.org/"),
               url-prefix("http://projects.apache.org/"),
               url-prefix("http://www.apache.org/") 
{

 html,
 body,
 td,
 th,
 .navigation,
 [bgcolor="#FFFFFF"]
  {
    background-color: #222 !important;
    color: #ccc !important;
    margin: 0 !important;
    padding: 0 !important;
  }

 a:link
  {
    color: #E8E1BD !important;
  }
 a:visited
  {
    color: #C8C19D !important;
  }
 a:link:hover,
 a:visited:hover
  {
    background-color: transparent !important;
    color: #fff !important;
  }

 
 img[src$="/apache_sub.gif"],
 img[src$="/apache_header.gif"],
 img[src$="/sub.gif"]
  {
    margin-bottom: 5px !important;
    padding-left: 275px !important;
    padding-top: 30px !important;
    height: 0 !important;
    width: 0 !important;
    background:
      url(data:image/png;base64,)
      !important;
  }

 img[src$="/httpd_logo_wide.gif"]
  {
    margin-bottom: 5px !important;
    padding-left: 275px !important;
    padding-top: 30px !important;
    height: 0 !important;
    width: 0 !important;
    background:
      url(data:image/png;base64,)
      !important;
  }

 img[src$="/asf_logo_wide.gif"]
  {
    margin-bottom: 5px !important;
    padding-left: 300px !important;
    padding-top: 30px !important;
    height: 0 !important;
    width: 0 !important;
    background:
      url(data:image/png;base64,)
      !important;
  }

 table#indextable td,
 #headerSection, #footerSection, hr, .space, .col
  {
    background: transparent !important;
    border: 0 !important;
  }

 td[bgcolor="#525d76"],
 #quickview,
 table.directive,
 .apache,
 .category > h2,
 .colortable,
 .directive-section > h2,
 .related th,
 .section > h2,
 .section > h3
  {
    background-color: #444 !important;
    border: 1px solid #000 !important;
  }

 #page-content> h1,
 #preamble > h1,
 .colortable td,
 .navleft,
 .navright
  {
    background-color: #333 !important;
    border: 1px solid #000 !important;
    color: #ccc !important;
    padding: .25em !important;
  }

 .body
  {
    padding-left: 1em !important;
  }

 h1, h2, h3, h4, h5, h6,
 p > span,
 .related th
  {
    color: #ccc !important;
  }

 #footer,
 .related
  {
    border-color: #000 !important;
  }

 #quickview
  {
    background-color: #333 !important;
    color: #ccc !important;
    right: 5px !important;
  }

 table.directive th
  {
    background-color: #262C2D !important;
    border: 1px solid #334244 !important;
    color: #ccc !important;
    padding: .2em !important;
  }


 table.directive td
  {
    background-color: #334244 !important;
    border: 1px solid #262C2D !important;
    color: #ccc !important;
    padding: .2em !important;
  }


 .example
  {
    background-color: #262C2D !important;
    border: 1px solid #334244 !important;
    color: #ccc !important;
  }

 .note
  {
    background: #69675C !important;
    border: 1px solid #918E80 !important;
    color: #000 !important;
  }
 .note > h3
  {
    color: #000 !important;
  }
 .note .directive
  {
    color: #ddd !important;
  }

 .warning
  {
    background: #000 !important;
    border: 2px dotted #ccc !important;
    color: #b97 !important;
  }

/* Convex Overlay */
 body  /* http://httpd.apache.org/docs/1.3/ */
  > div[align="center"]:first-child
  > table[width="600"]
  > tbody
  > tr:first-child
  {
    background-color: #3E3D39 !important;
    background-image:
      url(data:image/png;base64,)
      !important;
    background-repeat: repeat-x !important;
    background-position: top left !important;
  }

/* Top Inset Shadow */
 body  /* http://httpd.apache.org/docs/1.3/ */
  > div[align="center"]:first-child
  > table[width="600"]
  > tbody
  > tr
  > td[bgcolor="#4f4f4f"]
  {
    background-image:
      url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAFCAYAAACEhIafAAAABGdBTUEAAK/INwWK6QAAABl0RVh0U29mdHdhcmUAQWRvYmUgSW1hZ2VSZWFkeXHJZTwAAAAeSURBVHjaYmJgYLjBDCSMQYQgiPjO8P//fwaAAAMAJTYFHO3UrGIAAAAASUVORK5CYII=)
      !important;
    background-repeat: repeat-x !important;
    background-position: top left !important;
  }

/* Top-Left Inset Shadow */
 td[bgcolor="#bebebe"] > a:link:hover
  {
    background-image:
      url(data:image/png;base64,)
      !important;
    background-repeat: no-repeat !important;
    background-position: top left !important;
  }

}

@-moz-document url-prefix("http://httpd.apache.org/docs/1.3/")
{

 body
  > div[align="center"]
  > table[width="600"],
 body
  > div[align="center"]:not(:first-child)
  > table[width="600"]
  > tbody
  > tr
  > td
  > table
  {
    width: 100% !important;
  }


 img[src$="images/index.gif"]
  {
    border: 0 !important;
    margin-bottom: 5px !important;
    padding-left: 55px !important;
    padding-top: 48px !important;
    height: 0 !important;
    width: 0 !important;
    background:
      no-repeat
      top right
      url(data:image/png;base64,)
      !important;
  }

 img[src$="images/home.gif"]
  {
    border: 0 !important;
    margin-bottom: 5px !important;
    padding-left: 42px !important;
    padding-top: 42px !important;
    height: 0 !important;
    width: 0 !important;
    background:
      url(data:image/png;base64,)
      !important;
  }

 /* top menu items
  */
 body
  > div[align="center"]:first-child
  > table[width="600"]
  > tbody
  > tr:not(:first-child):not(:last-child)
  > td
  > table
  {
    width: 600px !important;
  }
 body
  > div[align="center"]:first-child
  > table[width="600"]
  > tbody
  > tr
  > td[bgcolor="#4f4f4f"]
  {
    padding-top: 10px !important;
  }
 td[bgcolor="#4f4f4f"],
 td[bgcolor="#bebebe"]
  {
    background-color: transparent !important;
  }
 td[bgcolor="#bebebe"] > a:link,
 td[bgcolor="#bebebe"] > a:link:visited
  {
    background-color: #444 !important;
    border: 1px outset #666 !important;
    padding: 2px 5px !important;
  }
 td[bgcolor="#bebebe"] > a:link:hover
  {
    background-color: #555 !important;
    border: 1px inset #666 !important;
  }

 /* content table headers
  */
 td[bgcolor="#e9e9e9"]
  {
    background-color: #444 !important;
    border: 1px solid #000 !important;
  }

 /* content vertical separator
  */
 body
  > div[align="center"]:not(:first-child)
  > table[width="600"]:not(:first-child)
  > tbody
  > tr
  > td[bgcolor="#cccccc"]:not(:first-child),
 body
  > div[align="center"]:not(:first-child)
  > table[width="600"]:not(:first-child)
  > tbody
  > tr
  > td[bgcolor="#cccccc"]:not(:first-child)
  > table[bgcolor="#cccccc"]
  {
    background-color: transparent !important;
  }


}
